scriptlet.script:
var name=scriptletContext.get("remoteFile");
name=name.split("/");
var len=parseInt(name.length-1);
name=name[len];

scriptletResult = scriptletInput+name;

var ent=scriptletInput.split("\n");
var salida="";

var countVentas="0";
var acumVentasusd="0";
var acumVentasLocal="0";
ban=false;
for(i=0;i<ent.length;i++){
 	if(ent[i].search(/first\s+PRES\.\s+purchase/ig)!=-1){ban=true;}
 	if(ent[i].search(/first\s+PRES\.\s+TOTAL/ig)!=-1){salida+=ent[i]+"\n";ban=false;}
 	if(ban==true){salida+=ent[i]+" "+i+"\n";}

}
scriptletResult=salida;

var ent=scriptletInput.split("\n");
var salida="";
var acumVentas="0";
var acumVentasUSD="0";
var countVentaUSD="0";
var countVenta="0";
for(i=0;i<ent.length;i++){
	if(ent[i].search(/PURCHASE/ig)!=-1){
		if(ent[i].search(/USD/g)!=-1){
	 		acumVentasUSD=parseFloat(parseFloat(acumVentasUSD)+parseFloat(ent[i].substring(65,83).replace(/\,/g,"").replace(/\./g,""))/100+parseFloat(ent[i].substring(100,115).replace(/\,/g,"").replace(/\./g,""))/100);
	 		countVentaUSD=parseInt(parseInt(countVentaUSD)+parseInt(ent[i].substring(55,60)));
	 		salida+="USD linea:"+i+" "+parseFloat(ent[i].substring(65,83).replace(/\,/g,"").replace(/\./g,""))/100+"\n";
	 	}
	 	else{
	 		acumVentas=parseFloat(parseFloat(acumVentas)+parseFloat(ent[i].substring(65,83).replace(/\,/g,"").replace(/\./g,""))/100+parseFloat(ent[i].substring(100,115).replace(/\,/g,"").replace(/\./g,""))/100);
	 		countVenta=parseInt(parseInt(countVenta)+parseInt(ent[i].substring(55,60)));
	 		salida+="Local linea:"+i+" "+parseFloat(ent[i].substring(65,83).replace(/\,/g,"").replace(/\./g,""))/100+"\n";
	 	}
	}
}

scriptletResult=salida+"\nTotal de Ventas Locales: "+acumVentas+"\nTotal TRX Locales Venta:"+countVenta +"\n\nTotal USD:"+acumVentasUSD+"\nTotal TRX USD Venta:"+countVentaUSD;
scriptletContext.putGlobal("T140VentasL",acumVentas);
scriptletContext.putGlobal("T140TRXVentasL",countVenta);
scriptletContext.putGlobal("T140VentasU",acumVentasUSD);
scriptletContext.putGlobal("T140TRXVentasU",countVentaUSD);

